    "2015-09-27T00:09:01.451400",nt"name": "afsc-refm-seabird-food-habits-dataset-of-the-north-pacific",nt"isopen":
    false,nt"url": null,nt"notes": "The seabird food habits dataset contains
    information on the stomach contents from seabird specimens that were collected under
    salvage and scientific collection permits primarily by NMFS-certified fisheries
    observers deployed by the Pacific Islands Regional Office Observer Program to shallow
    and deep set pelagic longline fisheries operating in North Pacific waters and fisheries
    observers deployed by the Alaska Fisheries Science Center Observer Program to groundfish
    demersal longline, pot, and trawl fisheries in waters off Alaska.  The database
    includes Magnuson-Act protected data on the precise date and location where the
    specimen was collected and publicly available information on the stomach contents.
     Necropsy data were completed as a parallel program.",nt"license_title": null,nt"extras":
